    (if (or (< spmax sp) (= new-gene (vec (replicate length 0)) )) 
      
      ;(assoc (vec (repeat length 0)) (rand-int length) 1)
    
      (new-poly-term max_pow spmax length)
      ;[0 1];;cant have this or else it will crash the mathematica
