;;; {"type":"html","content":"<span class='clj-var'>#&#x27;goliath/zeitgeist_create-genotype</span>","value":"#'goliath/zeitgeist_create-genotype"}
;; <=

;; @@
(defn random-initial-population 
  
   "creates an innitial population of polynimials
  size - number of individuals in the population"
   
  [size max_length max_power max_sum_powers num_terms]
 
  (repeatedly size #(zeitgeist_create-genotype max_length max_power max_sum_powers num_terms)) 
       
  )
